async () => {
    const entityKycData = await CNXQueryJSObject.getEntityKYCDocData();

    if(entityKycData && entityKycData.length) {
        try {
            entityKycData.forEach(async (data) => {
                await InsertEntityKYCDetails.run({
                    docType: data.docTypeCode,
                    fileName: data.FileName,
                    link: data.url,
                });
            });
        } catch (e) {
            return false;
        }			
    }
		return true;
  }

